    document.getElementById('input-search').addEventListener('input', function() {
        const searchText = this.value; 
        const resultDiv = document.getElementById('result');
        resultDiv.innerHTML = ''; 

        if (searchText) {
            const result = urlIcons.filter((icon) => icon.toLowerCase().includes(searchText.toLowerCase()));
            result.forEach(iconPath => {
                const fullUrl = `${path}${iconPath}`;
                const image = document.createElement('img');
                image.src = fullUrl; // URL của ảnh SVG
                image.alt = 'Description of the image'; // Văn bản thay thế cho ảnh
                image.style.width = '20px'; // Đặt chiều rộng cho ảnh
                image.style.height = '20px'; // Đặt chiều cao cho ảnh
                
                image.addEventListener('click', (ev) => {
                    // Gửi dữ liệu SVG đến Figma
                    parent.postMessage({ pluginMessage: { type: 'import-svg', iconPath } }, '*');
                });

                const resultItem = document.createElement('div');
                resultItem.className = 'row';
                resultItem.style.cssText = 'heght:100%;padding: 1rem; gap: 8px; border-radius: 0.6rem; background-color: #F4F4F5;';
                

                const resultText = document.createElement('p');
                resultText.className = 'comp-text subtitle-3';
                resultText.textContent = `${iconPath}`;

                resultItem.appendChild(image);
                resultItem.appendChild(resultText);
                resultDiv.appendChild(resultItem);
            });                                                                     
        } else {
            const defaultItem = document.createElement('div');
            resultDiv.appendChild(defaultItem);
        }
    });
